import React from 'react';
import './ClaimList.css';

const ClaimList = () => {
    // Пример данных для жалоб. В реальном приложении они могут быть получены из API.
    const claims = [
        { id: 1, title: 'Неполадки с машиной A', status: 'В процессе' },
        { id: 2, title: 'Задержка в обслуживании машины B', status: 'Закрыто' },
        { id: 3, title: 'Ошибка в документации C', status: 'Ожидает ответа' },
    ];

    return (
        <div className="claim-list">
            <h1>Список жалоб</h1>
            <table>
                <thead>
                    <tr>
                        <th>ID</th>
                        <th>Название жалобы</th>
                        <th>Статус</th>
                    </tr>
                </thead>
                <tbody>
                    {claims.map(claim => (
                        <tr key={claim.id}>
                            <td>{claim.id}</td>
                            <td>{claim.title}</td>
                            <td>{claim.status}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
}

export default ClaimList;
